// And groups predicates with the AND operator between them.
func And(predicates ...predicate.SMSCampaign) predicate.SMSCampaign {
	return predicate.SMSCampaign(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.SMSCampaign) predicate.SMSCampaign {
	return predicate.SMSCampaign(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.SMSCampaign) predicate.SMSCampaign {
	return predicate.SMSCampaign(sql.NotPredicates(p))
}
